INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(1, 'La stanza delle necessità', 'Ricrea una stanza magica che può essere scoperta solo da chi ne ha bisogno con il playset Hogwarts™: la Stanza delle Necessità LEGO® Harry Potter™ (76413) per i bambini dagli 8 anni in su. Il set contiene una sezione del castello di Hogwarts costruita in mattoncini che si apre per facilitare il gioco. La Stanza delle Necessità è piena di oggetti, tra cui un giradischi costruibile e un elemento diadema, e c’è anche una stanza staccabile al piano superiore per la Dama Grigia.', 1, 'data:image/jpeg;base64,', 29.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(2, 'Hogwarts, La sala grande', 'Costruisci e ricrea il regno di fantasia magica dei film di Harry Potter™ con questo dettagliato set della Sala Grande di Hogwarts™ LEGO® Harry Potter™ 75954 a 4 piani, con caminetto, panche, tavoli e stendardi reversibili, oltre alla torre con la Grande Scalinata dotata di scala a chiocciola, aula delle pozioni, sala del tesoro, cappello di smistamento, Specchio delle Brame e tanti altri accessori magici. Questo fantastico castello per il gioco di ruolo include 10 minifigure e le creature del Basilisco e di Fanny™, oltre ai personaggi di Edvige™ e Crosta™.', 1, 'data:image/jpeg;base64,', 99.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(3, 'Castello Di Hogwarts', 'Porta in vita la magia nel Castello di Hogwarts LEGO Harry Potter 71043! Questo set da collezione LEGO Harry Potter estremamente dettagliato contiene oltre 6.000 pezzi e offre unesperienza di costruzione altamente gratificante.', 1, 'data:image/jpeg;base64,', 499.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(4, 'Il platano picchiatore', 'Il platano picchiatore', 1, 'data:image/jpeg;base64,', 69.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(5, 'Il Baule Magico di Hogwarts', 'Personalizzato e portatile, Il baule magico di Hogwarts™ LEGO® Harry Potter™ (76399) per la fascia di età 8+ è pieno di un magico mix di luoghi e persone personalizzabili tratti dai film di Harry Potter.', 1, 'data:image/jpeg;base64,', 39.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(6, 'Cortile di Hogwarts', 'Descrizione prodotto. I giovani maghi e le giovani streghe si uniscono ad Harry Potter, Ron Weasley ed Hermione Granger per preparare la potente pozione polisucco.', 1, 'data:image/jpeg;base64,', 34.25);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(7, 'Treno passeggeri espresso', 'Il set LEGO® City Treno passeggeri espresso (60337) include una locomotiva ad alta velocità telecomandata con fari dimmerabili funzionanti e tecnologia LEGO Powered Up, un vagone ristorante, una carrozza per i passeggeri, una banchina della stazione, 24 pezzi di binari e 6 minifigure per infinite ore di gioco a tema ferroviario.', 3, 'data:image/jpeg;base64,', 159.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(8, 'Accademia della polizia', 'Il set Accademia di addestramento della polizia LEGO® City (60372) è caratterizzato da una stazione di polizia modulare a più stanze e da un percorso a ostacoli all’aperto con divertenti strutture, tra cui una parete da arrampicata, una scala orizzontale e una teleferica. Include anche un fuoristrada sterzabile, 6 minifigure e un cavallo.', 3, 'data:image/jpeg;base64,', 89.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(9, 'Auto sportiva elettrica', 'I piccoli amanti delle macchinine impazziranno per l\'Auto sportiva elettrica LEGO® City (60383), con un design futuristico caratterizzato da dettagli di colore giallo fluorescente, ruote dal look esclusivo e un enorme spoiler posteriore. Questo set di gioco include anche una stazione di ricarica giocattolo e una minifigura del pilota, per un divertente gioco di ruolo.', 3, 'data:image/jpeg;base64,', 9.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(10, 'Barca di soccorso antincendio', 'Entusiasmanti avventure infuocate ti aspettano con questo playset Barca di soccorso antincendio LEGO® City (60373), caratterizzato da una fantastica barca dei pompieri e un gommone. I bambini possono lanciare gli elementi acqua LEGO con l’estintore della barca e il jetpack del pompiere per domare le fiamme LEGO. Basta aggiungere le 3 minifigure incluse e lascia che il divertimento abbia inizio.', 3, 'data:image/jpeg;base64,', 19.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(11, 'Addestramento cinofilo', 'I bambini e cinofili dai 5 anni in su ameranno questo playset giocattolo Addestramento cinofilo mobile LEGO® City (60369). Ricco di ispirazione per il gioco di fantasia, il set è dotato di un SUV K9, un rimorchio e 3 attività per l’addestramento dei cani, tra cui un’altalena, una barra per il salto e pedane. Basta aggiungere i poliziotti, il cane e il cucciolo per iniziare il divertimento.', 3, 'data:image/jpeg;base64,', 19.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(12, 'Scavatrice per costruzioni MS', 'Scatena la fantasia dei bambini con la Scavatrice per costruzioni LEGO® City (60385), dotata di martello pneumatico, pala e secchio intercambiabili come accessori. Questo divertente set di gioco include anche una panchina intelligente giocattolo, 2 minifigure di operai e divertenti accessori, per lunghe ore di gioco ispirate alle costruzioni, adatte i bambini dai 5 anni in su.', 3, 'data:image/jpeg;base64,', 19.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(13, 'LEGO Walker AT-TE', 'Fai rivivere ai fan di Star Wars: La Vendetta dei Sith dai 9 anni in su la battaglia di Utapau, con il fantastico set LEGO Star Wars Walker AT-TE (75337). Un possente modellino da costruire con i mattoncini LEGO, per combattere contro l\'esercito separatista dei Droidi.', 2, 'data:image/jpeg;base64,', 154.5);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(14, 'Star Wars™ 75325 Starfighter', 'Le storie di Tatooine della serie Star Wars: The Book of Boba Fett prendono vita per i giovani costruttori con questo modello in mattoncini LEGO® dello Starfighter N-1 del Mandaloriano (75325). Il velivolo è dotato di abitacolo per una minifigure, spazio passeggero per Grogu, vano di carico, uno shooter a molla e dettagli realistici. ', 2, 'data:image/jpeg;base64,', 54.29);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(15, 'ACTION BATTLE', 'Duella con i tuoi amici nella divertente sfida LEGO® Star Wars™ Action Battle - Assalto a Endor! Costruisci l’albero e la speeder bike, quindi metti il guerriero Ewok Wicket e lo Scout Trooper su ciascun elemento. Carica gli shooter, prendi la mira e colpisci il bersaglio del tuo avversario per far volare il suo personaggio! Vinci per i Ribelli, Comandante!', 2, 'data:image/jpeg;base64,', 25.49);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(16, 'Star Wars™ 75337 Walker', 'Ricrea la battaglia di Utapau con questo fantastico Walker AT-TE LEGO® Star Wars™ (75337). Una magnifica idea regalo per i fan di Star Wars: La vendetta dei Sith dai 9 anni in su, questo giocattolo da costruzione è caratterizzato da gambe snodabili, un pesante cannone blaster che si solleva e ruota di 360°, 2 shooter, un abitacolo per minifigure staccabile e 2 cabine dettagliate con spazio sufficiente per 7 minifigure LEGO.', 2, 'data:image/jpeg;base64,', 119.41);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(17, 'STAR WARS–THE JUSTIFIER', ' L’astronave giocattolo Justifier ha una cabina di pilotaggio dettagliata e di facile accesso e il motore posteriore si ripiega su e giù per le modalità di volo e atterraggio', 2, 'data:image/jpeg;base64,', 169.99);
INSERT INTO `catalogo` (`id`, `nome`, `descrizione`, `id_categoria`, `immagine`, `prezzo`) VALUES
(18, 'Star Wars X-Wing Fighter', 'Questo modello costruibile di starfighter misura 8 cm di altezza, 31 cm di lunghezza e 28 cm di larghezza ed è perfetto da esporre nella cameretta tra una missione e l’altra', 2, 'data:image/jpeg;base64,', 44.99);

